import React,{Component} from 'react';
import './History.css'
import axios from "axios"
class History extends Component{
    constructor (props) {
        super(props)
        this.state = {
          data:[],
          time:[],
          name:''
        }
     }
    componentDidMount() {
        axios.get('/history')
        .then(res=>{
        //   console.log(res.data);
          this.setState({
            data:res.data
            // order1:res.data
        });
        })
        axios.get('/history_time')
        .then(res=>{
        //   console.log(res.data);
          this.setState({
            // order:res.data
            time:res.data
        });
        })
        axios.get('/test')
        .then(res=>{
        //   console.log(res.data);
          this.setState({
            name:res.data
        });
        })
    }
    

  render(){
    //   var data=this.props.data;
      console.log(this.state.data,this.state.time);
    //   var d=data[0] || {soluong:1};
      return(
        <div className="cart">
            <p><b>GIỎ HÀNG </b></p>
            <div className="tb">
                <div className="tb1">
                    <div className="row tb1top">
                        <div className="col-7 clear"><p className="">TÊN SẢN PHẨM</p></div>
                        <div className="col-5 row">
                            <div className="col-4"><p>GIÁ TIỀN</p></div>
                            <div className="col-3"><p>SỐ LƯỢNG</p></div>
                            <div className="col-4"><p>CỘNG</p></div>
                            <div className="col-1"></div>
                        </div>
                    </div>
         
                    
                    <div className="row tb1top" >
                        <div className="col-7 clear">
                            <a href=""><button className="cart-button" onClick={this.cl} ><b>XÓA GIỎ HÀNG</b></button></a>
                        </div>
                        <div className="col-5 row">
                            <div className="col-7 c">
                                <a href="/"><button className="cart-button"><b>TIẾP TỤC MUA HÀNG</b></button></a>
                            </div>
                            <div className="col-5 c">
                                <a href=""><button className="cart-button" onClick={this.update}><b>CẬP NHẬT</b></button></a>
                            </div>
                        </div>
                    </div>
                </div>
            </div>
            <div className="row">
                <div className="col-7"></div>
                <div className="col-5 tb2 ">
                    <div className="row">
                        <div className="col-8">
                            Cộng
                        </div>
                        <div className="col-4">
                            {this.state.tong}
                        </div>
                    </div>
                    <div className="row">
                        <div className="col-8">
                          <p>Shipping &#38; Handling (Phí vận chuyển)</p>
                        </div>
                        <div className="col-4">
                            30000
                        </div>
                    </div>
                    <div className="row">
                        <div className="col-8">
                            <b>Tổng</b>
                        </div>
                        <div className="col-4">
                            <b>{this.state.tong+30000}</b>
                        </div>
                    </div>
                    <a href=""><button className="ca-button" onClick={this.tt} ><b>THANH TOÁN</b></button></a>
                </div>
            </div>
        </div>
      )
  }
}
export default History;
